pragma solidity >=0.4.23;

import "./thing.sol";

contract DSValue is DSThing {
    bool has;
    bytes32 val;

    function peek() public view returns (bytes32, bool) {
        return (val, has);
    }

    function read() public view returns (bytes32) {
        bytes32 wut;
        bool haz;
        (wut, haz) = peek();
        require(haz, "haz-not");
        return wut;
    }

    function poke(bytes32 wut) public {
        val = wut;
        has = true;
    }

    function void() public {
        // unset the value
        has = false;
    }
}
